   169‚Üí  /**
   170‚Üí   * Detect report type (raw power values or Z-scores)
   171‚Üí   * @param {Object} file - Multer file object
   172‚Üí   * @returns {Promise<string>} 'raw' or 'zscore'
   173‚Üí   */
   174‚Üí  static async detectReportType(file) {
   175‚Üí    try {
   176‚Üí      console.log(`üîç Detecting report type for: ${file.originalname}`);
   177‚Üí
   178‚Üí      const dataBuffer = fs.readFileSync(file.path);
   179‚Üí      const pdfData = await pdfParse(dataBuffer);
   180‚Üí      const text = pdfData.text.toLowerCase();
   181‚Üí
   182‚Üí      // Keyword detection
   183‚Üí      const zscoreKeywords = ['z-score', 'z score', 'z =', 'z=', 'standard deviation', 'sd from mean'];
   184‚Üí      const rawKeywords = ['absolute power (Œºv¬≤)', 'absolute power (uv¬≤)', 'relative power (%)', 'Œºv¬≤', 'uv¬≤'];
   185‚Üí
   186‚Üí      let zscoreCount = 0;
   187‚Üí      let rawCount = 0;
   188‚Üí
   189‚Üí      // Count keyword occurrences
   190‚Üí      zscoreKeywords.forEach(keyword => {
   191‚Üí        const matches = (text.match(new RegExp(keyword, 'g')) || []).length;
   192‚Üí        zscoreCount += matches;
   193‚Üí      });
   194‚Üí
   195‚Üí      rawKeywords.forEach(keyword => {
   196‚Üí        const matches = (text.match(new RegExp(keyword, 'g')) || []).length;
   197‚Üí        rawCount += matches;
   198‚Üí      });
   199‚Üí
   200‚Üí      console.log(`   Z-score keywords found: ${zscoreCount}`);
   201‚Üí      console.log(`   Raw power keywords found: ${rawCount}`);
   202‚Üí
   203‚Üí      // Decision logic
   204‚Üí      if (zscoreCount > rawCount && zscoreCount >= 3) {
   205‚Üí        console.log(`‚úÖ Detected: Z-SCORE report`);
   206‚Üí        return 'zscore';
   207‚Üí      } else if (rawCount > zscoreCount && rawCount >= 2) {
   208‚Üí        console.log(`‚úÖ Detected: RAW POWER report`);
   209‚Üí        return 'raw';
   210‚Üí      } else if (zscoreCount > 0 && rawCount > 0) {
   211‚Üí        // Mixed report - check for table structure
   212‚Üí        if (text.includes('z-score table') || text.includes('z score table')) {
   213‚Üí          console.log(`‚ö†Ô∏è Mixed report detected - preferring Z-SCORE`);
   214‚Üí          return 'zscore';
   215‚Üí        } else {
   216‚Üí          console.log(`‚ö†Ô∏è Mixed report detected - preferring RAW POWER`);
   217‚Üí          return 'raw';
   218‚Üí        }
   219‚Üí      } else {
   220‚Üí        // Fallback: assume raw if unclear
   221‚Üí        console.warn(`‚ö†Ô∏è Could not clearly detect report type - defaulting to RAW POWER`);
   222‚Üí        return 'raw';
   223‚Üí      }
   224‚Üí
   225‚Üí    } catch (error) {
   226‚Üí      console.error(`‚ùå Error detecting report type for ${file.originalname}:`, error.message);
   227‚Üí      // Safe default
   228‚Üí      console.warn(`   Defaulting to RAW POWER mode`);
   229‚Üí      return 'raw';
   230‚Üí    }
   231‚Üí  }
