   233‚Üí  /**
   234‚Üí   * Main method to parse uploaded files
   235‚Üí   * @param {Object} eyesOpenFile - Multer file object for Eyes Open data
   236‚Üí   * @param {Object} eyesClosedFile - Multer file object for Eyes Closed data
   237‚Üí   * @returns {Object} Parsed QEEG data
   238‚Üí   */
   239‚Üí  static async parse(eyesOpenFile, eyesClosedFile) {
   240‚Üí    try {
   241‚Üí      console.log('\nüìÑ === QEEG File Parsing Started ===');
   242‚Üí      console.log('  - Eyes Open:', eyesOpenFile?.originalname);
   243‚Üí      console.log('  - Eyes Closed:', eyesClosedFile?.originalname);
   244‚Üí
   245‚Üí      // STEP 1: Detect report types
   246‚Üí      console.log('\nüîç STEP 1: Detecting report types...');
   247‚Üí      const eoReportType = await this.detectReportType(eyesOpenFile);
   248‚Üí      const ecReportType = await this.detectReportType(eyesClosedFile);
   249‚Üí
   250‚Üí      console.log(`\nüìä Detection Results:`);
   251‚Üí      console.log(`  - Eyes Open: ${eoReportType.toUpperCase()}`);
   252‚Üí      console.log(`  - Eyes Closed: ${ecReportType.toUpperCase()}`);
   253‚Üí
   254‚Üí      // STEP 2: Validate matching types
   255‚Üí      console.log('\n‚úì STEP 2: Validating report type consistency...');
   256‚Üí      if (eoReportType !== ecReportType) {
   257‚Üí        const error = new Error(
   258‚Üí          `‚ùå Mismatched report types detected!\n\n` +
   259‚Üí          `Eyes Open is ${eoReportType.toUpperCase()}, but Eyes Closed is ${ecReportType.toUpperCase()}.\n\n` +
   260‚Üí          `Both files must be the same type (either both RAW POWER or both Z-SCORE reports).\n` +
   261‚Üí          `Please upload matching report types and try again.`
   262‚Üí        );
   263‚Üí        error.code = 'REPORT_TYPE_MISMATCH';
   264‚Üí        throw error;
   265‚Üí      }
   266‚Üí
   267‚Üí      const reportType = eoReportType;
   268‚Üí      console.log(`‚úÖ Report type validated: ${reportType.toUpperCase()} mode\n`);
   269‚Üí
   270‚Üí      // STEP 3: Determine file formats (pdf, csv, excel)
   271‚Üí      console.log('üìÅ STEP 3: Determining file formats...');
   272‚Üí      const eoFileType = this.getFileType(eyesOpenFile.originalname);
   273‚Üí      const ecFileType = this.getFileType(eyesClosedFile.originalname);
   274‚Üí      console.log(`  - Eyes Open: ${eoFileType}`);
   275‚Üí      console.log(`  - Eyes Closed: ${ecFileType}\n`);
   276‚Üí
   277‚Üí      // STEP 4: Parse each file with appropriate method
   278‚Üí      console.log('üìñ STEP 4: Extracting data from files...');
   279‚Üí      const eyesOpenData = await this.parseFile(eyesOpenFile, eoFileType, 'EO', reportType);
   280‚Üí      const eyesClosedData = await this.parseFile(eyesClosedFile, ecFileType, 'EC', reportType);
   281‚Üí
   282‚Üí      // STEP 5: Combine data with metadata
   283‚Üí      console.log('\nüîó STEP 5: Combining data...');
   284‚Üí      const combinedData = {
   285‚Üí        EO: eyesOpenData,
   286‚Üí        EC: eyesClosedData,
   287‚Üí        dataType: reportType // Add metadata
   288‚Üí      };
   289‚Üí
   290‚Üí      console.log(`‚úÖ QEEG files parsed successfully in ${reportType.toUpperCase()} mode`);
   291‚Üí      console.log('=== QEEG File Parsing Completed ===\n');
   292‚Üí      return combinedData;
   293‚Üí
   294‚Üí    } catch (error) {
   295‚Üí      console.error('\n‚ùå === QEEG File Parsing Failed ===');
   296‚Üí      console.error('Error:', error.message);
   297‚Üí      if (error.code === 'REPORT_TYPE_MISMATCH') {
   298‚Üí        // Re-throw mismatch errors with original message
   299‚Üí        throw error;
   300‚Üí      } else {
   301‚Üí        throw new Error(`Failed to parse QEEG files: ${error.message}`);
   302‚Üí      }
   303‚Üí    }
   304‚Üí  }
