   306‚Üí  /**
   307‚Üí   * Determine file type from filename
   308‚Üí   */
   309‚Üí  static getFileType(filename) {
   310‚Üí    const ext = path.extname(filename).toLowerCase();
   311‚Üí    if (ext === '.pdf') return 'pdf';
   312‚Üí    if (ext === '.csv') return 'csv';
   313‚Üí    if (ext === '.xlsx' || ext === '.xls') return 'excel';
   314‚Üí    throw new Error(`Unsupported file type: ${ext}`);
   315‚Üí  }
