   317‚Üí  /**
   318‚Üí   * Parse a single file based on its type
   319‚Üí   */
   320‚Üí  static async parseFile(file, fileType, condition, reportType = 'raw') {
   321‚Üí    if (fileType === 'pdf') {
   322‚Üí      return await this.parsePDF(file, condition, reportType);
   323‚Üí    } else if (fileType === 'csv') {
   324‚Üí      return this.parseCSV(file);
   325‚Üí    } else if (fileType === 'excel') {
   326‚Üí      return this.parseExcel(file);
   327‚Üí    }
   328‚Üí    throw new Error(`Unknown file type: ${fileType}`);
   329‚Üí  }
