   342‚Üí      // Z-SCORE extraction prompt
   343‚Üí      return `You are a QEEG Z-score data extraction expert. Extract Z-score values from this ${conditionName} QEEG report.
   344‚Üí
   345‚Üí**IMPORTANT**: Z-scores represent standard deviations from the mean. They typically range from -3 to +3.
   346‚Üí- Negative values = below average (lower than normal)
   347‚Üí- Zero (0) = average (normal)
   348‚Üí- Positive values = above average (higher than normal)
   349‚Üí
