   356‚Üí- Theta (4-8 Hz)
   357‚Üí- Alpha (8-13 Hz)
   358‚Üí- Beta (13-30 Hz)
   359‚Üí- HiBeta / High Beta (20-30 Hz)
   360‚Üí
   361‚ÜíAlso extract:
   362‚Üí- Alpha Peak Frequency (Hz) and its Z-score if available
   363‚Üí
