   367‚Üí- No markdown formatting (no \`\`\`json or \`\`\`)
   368‚Üí- No explanations before or after
   369‚Üí- No comments
   370‚Üí- Just pure JSON that starts with { and ends with }
   371‚Üí
   372‚ÜíReturn ONLY this EXACT JSON format:
   373‚Üí{
   374‚Üí  "zscores": {
   375‚Üí    "absolute": {
