   400‚Üí    "alphaPeakZscore": 0.0
   401‚Üí  }
   402‚Üí}
   403‚Üí
   404‚ÜíPDF Content:
   405‚Üí${pdfText.substring(0, 15000)}`;
   406‚Üí
