   537‚Üí  /**
   538‚Üí   * Calculate MD5 hash of PDF file for caching
   539‚Üí   * @param {Buffer} dataBuffer - PDF file buffer
   540‚Üí   * @returns {string} MD5 hash
   541‚Üí   */
   542‚Üí  static calculatePDFHash(dataBuffer) {
   543‚Üí    return crypto.createHash('md5').update(dataBuffer).digest('hex');
   544‚Üí  }
   545‚Üí
   546‚Üí  /**
   547‚Üí   * Normalize extracted value to consistent decimal places
   548‚Üí   * Prevents precision-related variations
   549‚Üí   * @param {number} value - The value to normalize
   550‚Üí   * @param {number} decimalPlaces - Number of decimal places (default: 2)
   551‚Üí   * @returns {number|null} Normalized value
   552‚Üí   */
   553‚Üí  static normalizeValue(value, decimalPlaces = 2) {
   554‚Üí    if (value === null || value === undefined || isNaN(value)) {
   555‚Üí      return null;
   556‚Üí    }
   557‚Üí
   558‚Üí    // Round to consistent decimal places
   559‚Üí    const multiplier = Math.pow(10, decimalPlaces);
   560‚Üí    return Math.round(value * multiplier) / multiplier;
   561‚Üí  }
