   563‚Üí  /**
   564‚Üí   * Normalize all values in extracted QEEG data
   565‚Üí   * Ensures consistent precision across all measurements
   566‚Üí   * @param {Object} extractedData - The raw extracted data
   567‚Üí   * @returns {Object} Normalized data
