   585‚Üí        Object.keys(normalized.relative[channel]).forEach(band => {
   586‚Üí          normalized.relative[channel][band] =
   587‚Üí            this.normalizeValue(normalized.relative[channel][band], 2);
   588‚Üí        });
   589‚Üí      });
   590‚Üí    }
   591‚Üí
   592‚Üí    // Normalize special values (alpha peak, etc.)
   593‚Üí    if (normalized.special) {
   594‚Üí      Object.keys(normalized.special).forEach(key => {
   595‚Üí        normalized.special[key] = this.normalizeValue(normalized.special[key], 2);
   596‚Üí      });
   597‚Üí    }
   598‚Üí
   599‚Üí    // Normalize zscores if present (for z-score reports)
   600‚Üí    if (normalized.zscores) {
   601‚Üí      if (normalized.zscores.absolute) {
   602‚Üí        Object.keys(normalized.zscores.absolute).forEach(channel => {
   603‚Üí          Object.keys(normalized.zscores.absolute[channel]).forEach(band => {
   604‚Üí            normalized.zscores.absolute[channel][band] =
   605‚Üí              this.normalizeValue(normalized.zscores.absolute[channel][band], 2);
   606‚Üí          });
   607‚Üí        });
   608‚Üí      }
   609‚Üí      if (normalized.zscores.relative) {
   610‚Üí        Object.keys(normalized.zscores.relative).forEach(channel => {
   611‚Üí          Object.keys(normalized.zscores.relative[channel]).forEach(band => {
   612‚Üí            normalized.zscores.relative[channel][band] =
   613‚Üí              this.normalizeValue(normalized.zscores.relative[channel][band], 2);
   614‚Üí          });
   615‚Üí        });
   616‚Üí      }
   617‚Üí    }
   618‚Üí
   619‚Üí    return normalized;
