    console.log(`üìä Quota status: ${quotaCheck.dailyRemaining}/${this.dailyLimit} daily requests remaining`);
  }

  /**
   * Record that a request was made
   */
  recordRequest() {
    this.lastRequestTime = Date.now();
    this.dailyRequestCount++;
    this.minuteRequestCount++;

    console.log(`üìà API call recorded: ${this.dailyRequestCount}/${this.dailyLimit} today, ${this.minuteRequestCount}/${this.requestsPerMinute} this minute`);
  }

  /**
   * Get current quota status
   */
  getQuotaStatus() {
    this.checkAndResetDailyCounter();
    this.checkAndResetMinuteCounter();

    return {
      dailyUsed: this.dailyRequestCount,
      dailyLimit: this.dailyLimit,
      dailyRemaining: this.dailyLimit - this.dailyRequestCount,
      minuteUsed: this.minuteRequestCount,
      minuteLimit: this.requestsPerMinute,
      lastRequestTime: new Date(this.lastRequestTime).toISOString()
    };
  }
