    this.requestsPerMinute = parseInt(process.env.GEMINI_REQUESTS_PER_MINUTE) || 2;
    this.delayBetweenRequests = parseInt(process.env.GEMINI_REQUEST_DELAY_MS) || 30000; // 30 seconds default

