          `2. Re-upload the SAME files (uses cache, no quota)\n` +
          `3. Upgrade to paid plan at https://ai.google.dev/pricing\n\n` +
          `üìä Free tier: ${this.dailyLimit} requests/day\n` +
          `üí∞ Paid tier: 1000+ requests/day with billing enabled`
        );
        error.code = 'GEMINI_DAILY_QUOTA_EXCEEDED';
        throw error;
      }

      if (quotaCheck.reason === 'minute_limit') {
