  static validateAPIKey() {
    const apiKey = process.env.GEMINI_API_KEY;

    // Check if key exists
    if (!apiKey || apiKey.trim() === '') {
      const error = new Error('GEMINI_API_KEY environment variable is not set');
      error.code = 'MISSING_API_KEY';
