- Tables may span multiple pages - check thoroughly!

üß† CHANNELS TO EXTRACT (19 channels):
FP1, FP2, F7, F3, Fz, F4, F8, T3, C3, Cz, C4, T4, T5, P3, Pz, P4, T6, O1, O2

üìä FREQUENCY BANDS (ALL 5 REQUIRED):
